import React from "react";
import { NavLink } from "react-router-dom";
function DashboardUL({ img, title, path, element }) {
  return (
    <NavLink   className={({ isActive }) => (isActive ? 'active' : 'inactive')}
    to={path} className="dashboardurl">
      <img src={img} alt="img" />{" "}
      <NavLink
        //  activeStyle={{ color: 'red' }}
        // style={({ isActive }) => isActive ? { color: "red" } : { color: "blue" }}
      
      >
        {title}
      </NavLink>
    </NavLink>
  );
}

export default DashboardUL;
